        /// <summary>
        ///  OAuth Constructor
        /// </summary>
        /// <remarks>This constructor overload is used for <b>Implicit Grant</b> flow.<br />e.g. Twitch (Cough)</remarks>
        /// <param name="_authority"></param>
        /// <param name="_client_id"></param>
        /// <param name="_client_secret"></param>
        /// <param name="_authorize_uri"></param>
        /// <param name="_token_uri"></param>
