        public OAuthClient(string _authority, string _client_id, string _client_secret, string _authorize_uri, string _token_uri, string _redirect_uri, string _response_type, string _scope = "") {
            if (String.Compare(_authority, 0, "https://", 0, 8, StringComparison.OrdinalIgnoreCase) != 0) { // Why? Because I find it hilarious.
                new BotException($"{this.name}:_constructor", $"Could not instansiate OAuth. Reason: Authority scheme must be secure (https)");
                return;
            }

            Authority = _authority;
            ClientIdentity = _client_id;
            ClienttSecret = _client_secret;
            Auth_URI = _authorize_uri;
            Token_URI = _token_uri;
            RedirectURI = new Uri($@"http://localhost:{LoopbackPort}");// _redirect_uri;
            response_type = _response_type ?? throw new BotException($"{this.name}:_contstructor", $"Invalid or empty response_type");
            Scope = _scope;

            State = Generatestate();
        }


        /// <summary>
        ///  OAuth Constructor
        /// </summary>
        /// <remarks>This constructor overload is used for <b>Authorization Grant Code</b> flow.<br />You know, the right thing to do.</remarks>
        /// <param name="_host">The host with scheme</param>
        /// <param name="_client_id">Client Identifier</param>
        /// <param name="_client_secret">Client Secret</param>
        /// <param name="_authorize_uri">OAuth URI</param>
        /// <param name="_token_uri">Token URI</param>
        /// <param name="_redirect_uri">The redirect URI</param>
        /// <param name="_scope">Scope (optional) should be bot</param>
        public OAuthClient(string _host, string _client_id, string _client_secret, string _authorize_uri, string _token_uri, string _redirect_uri, string _scope = "ALLURBASES")
        {
            //if (!_host.ToLower().StartsWith("https://")) {
            if (String.Compare(_host, 0, "https://", 0, 8, StringComparison.OrdinalIgnoreCase) != 0) { // Why? Because I find it hilarious.
                new BotException($"{this.name}:_constructor", $"Could not instansiate OAuth. Reason: Authority scheme must be secure (https)");
                return;
            }

            Authority = _host;
            ClientIdentity = _client_id;
            ClienttSecret = _client_secret;
            RedirectURI = new Uri(_redirect_uri);

            Auth_URI = _authorize_uri;
            Token_URI = _token_uri;

            Scope = _scope;
            State = Generatestate();

            Auth_Header = Convert.ToBase64String(Encoding.UTF8.GetBytes($"{_client_id}:{_client_secret}"));
            ctx = new CancellationTokenSource();
        }


        /// <summary>
        ///  Start the OAuth loopback flow.
        /// </summary>
        /// <remarks>This is the entry point to start the OAuth flow for both new flows and revoking.<br />Do not use this for revoking. Use the Revoke() method instead.</remarks>
        /// <returns>Boolean - True:Success, False:Failure</returns>
        public async Task<bool> StartFlowAsync(bool revoke=false) { // OAuth flow entry point
            if (Flowing) { new BotException(name, $"Attempted to start a new flow while one is currently active."); return false; }

            /*
                Refactory - Maximum Effort.
                This is the heart of the flow

                Removals: OAuthCode (short-lived code should not be stored, use it and discard.)

                === Autorization Grant ===
                Start HTTPServer()
                Leg 1: Let resource owner request authorization from the authority
                resp -> (Optionally write to browser response received processing or something) - this is going to take some compartmenting to keep read open until finished and creating a new method to write
                Leg 2: Request Token using Authorization Code (This is where you will get your error responses to handle)
                resp ->
                    (2) Success -> write refresh_token and web token to env, and store them globally.
                    (2) Failure -> Make sure errors are logged approxiately, and all exceptions are caught and bubble up (use BotException) so we don't get any unobservable surprises.
                Cleanup -> dispose of HTTPServer and make sure HTTPListener is stopped/disposed/marked for GC'
                    (2) after making sure all globals are stored and env is saved, pass a JWT.Token() check
                JWT.Token -> if success dispose of OAuth instance. (it's not idisposable so maybe implemenant? idk see how things go then move from there.

                === Implicit Grant ===
                New shit to add, and handle cases for additional params in the URI.
                Other than that they're mostly the same, expect you won't get a JWT from Twitch.

                All done, bot should be ready to run
             */
            _event_oauthcode = new TaskCompletionSource<bool> ();
            Flowing = true;
            State = Generatestate();
            bool success = false;

            try {
                using (HTTPServer _httpserver = new HTTPServer(Authority, Auth_URI, State, this.HTTPServer_Callback, ctx)) {
                    success = await _httpserver.Start(); // HTTPServer entry point to start it.
                }

                if (success)
                    success = await request_token(1, revoke);

                if (success)
                    success = await JWT.Token();
                //Flowing = false;
                //if (success) return true;
            }
            catch (BotException) { /* recursive protection */ }
            catch (Exception ex) { new BotException($"{this.name}:Heart", $"Unhandled Exception", ex); }
            finally {
                Flowing = false;
            }

            Print(name, $"Outcome: '{success}'", PrintSeverity.Debug);
            return success;
        }


        /// <summary>
        ///  Re-initiate the OAuth flow
        /// </summary>
        /// <returns>Boolean - True:Success, False:Failure</returns>
        public async Task<bool> Revoke() => await StartFlowAsync(true);


        /// <summary>
        ///  Generate a nounce "state" for comparison on callback to protect against MiTM attacks, however not required for loopback, still implemented.
        /// </summary>
        /// <returns>String</returns>
        private string Generatestate() {
            Random rand = new Random();
            return new string(Enumerable.Repeat("ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789", 32).Select(s => s[rand.Next(s.Length)]).ToArray());
        }


        /// <summary>
        /// Send a POST request to the host's gateway to request a JWT using HTTPClient
        /// Resource use has been authorized by this point.
        /// </summary>
        /// <param name="type">Type of request - 1:Request Token, 2:Refresh Token</param>
        private async Task<bool> request_token(int type, bool revoke=false) { // Token valid 10 hours.
            if (!revoke && (JWT.Valid && !JWT.Expired)) { Print(this.name, $"Token is valid and not expired.", PrintSeverity.Warn); return false; }

            string endpointParams;

            switch (type) {
                case 1: endpointParams = $"?redirect_uri=unused&code={OAuthCode}&grant_type=authorization_code";
                    break;
                case 2: endpointParams = $"?refresh_token={REFRESH_TOKEN}&grant_type=refresh_token";
                    break;
                default: new BotException(this.name, "Invalid token request type.");
                    return false;
            }

            State = Generatestate(); // Generate a new state for a different request O_o  o_O Meow. I'm a cat.

            try {
                using (HttpClient hc = new HttpClient()) {
                    hc.DefaultRequestHeaders.Authorization = new AuthenticationHeaderValue("Basic", Auth_Header);
                    hc.DefaultRequestHeaders.Accept.Add(new MediaTypeWithQualityHeaderValue("application/json"));

                    var emptybody = new StringContent("");
                    emptybody.Headers.ContentType = new MediaTypeWithQualityHeaderValue("application/json");
                    emptybody.Headers.Add("X-JOYSTICK-STATE", State);

                    HttpResponseMessage resp = await hc.PostAsync(new Uri($"{Authority}{Token_URI}{endpointParams}"), emptybody);

                    if (resp.IsSuccessStatusCode) {
                        string respData = await resp.Content.ReadAsStringAsync();

                        foreach (var header in resp.Headers)
                            if (header.Key == "X-JOYSTICK-STATE" && (string.Join(", ", header.Value) != State))
                                Print(this.name, $"There was a mismatch in the return state from {Authority}. (Received {string.Join(", ", header.Value)} NOT {State})", PrintSeverity.Error);

                        try {
                            HostAuth _HostAuth = JsonSerializer.Deserialize<HostAuth>(respData)!;
                            if (string.IsNullOrEmpty(_HostAuth.access_token) || string.IsNullOrEmpty(_HostAuth.refresh_token)) throw new ArithmeticException("Something divided by zero");
                            ACCESS_TOKEN = _HostAuth.access_token;
                            REFRESH_TOKEN = _HostAuth.refresh_token;
                        } catch (Exception ex) {
                            new BotException(name, $"Unable to deserialize response from {Authority}.", ex);
                            return false;
                        }

                        Print(this.name, $"Succesfully received authorization from {Authority}.", PrintSeverity.Debug);

                        _ = Task.Run(() => {
                            FlushToDisk(); // Write Auth & Refresh Tokens to .env
                        });

                        return true; // Received Auth & Codes from Host.
                    } else {
                        Print(name, $"Failed to receive authorization from {Authority}. (HTTP {resp.StatusCode})", PrintSeverity.Error);
                        return false;
                    }
                }
            } catch (Exception ex) {
                new BotException(this.name, $"There was an error receiving authorization from {Authority}.", ex);
                return false;
            }
        }


        private class HostAuth {
            public required string access_token { get; set; }
            public required long expires_in { get; set; }
            public required string token_type { get; set; }
            public required string refresh_token { get; set; }
        }


        public async Task<bool> RefreshToken() => await request_token(2);

