        public async Task HTTPServer_Callback(string code) => OAuthCode = code;


        /// <summary>
        ///  HTTPServer Child Class <=======================================================================================================================================
        /// </summary>
        private class HTTPServer : IDisposable
        {
            private HttpListener? listener;
            private const string name = "HTTPServer";
            private CancellationTokenSource _ctc; // <===== Reference to Entire OAuth token, do not cancel unless you want failure
            private readonly string _state;
            private readonly string _auth_endpoint;
            private readonly string _authority;
            private readonly Func<string, Task> _oauth_callback_code;

            /// <summary>
            ///  Constrcuts a new HTTPListener client
            /// </summary>
            /// <param name="auth_uri">Uri - The Auth Uri Endpoint</param>
            /// <param name="state">String - Generated state for Headers</param>
            /// <param name="Callback">Delegate - String, out: Task</param>
            public HTTPServer(string authority, string auth_uri, string state, Func<string, Task> Callback, CancellationTokenSource ctx) {
                _state = state; // Store header state
                _authority = authority; // Store authority ?
                _auth_endpoint = auth_uri; // Store auth uri ?
                listener = new HttpListener(); // Meow
                _oauth_callback_code = Callback; // Callback delegate
                _ctc = ctx; // Store cancellations reference.

                listener.Prefixes.Add($"http://127.0.0.1:{LoopbackPort}/auth/");

                if (DEBUGGING_ENABLED) Print(name, "HTTPServer Constructed.", PrintSeverity.Debug);
            }


            /// <summary>
            ///  Starts the HTTPListener for OAuth2 Loopback Flow.
            /// </summary>
            /// <remarks>Flow should be cancelled if failure is returned.</remarks>
            /// <returns>Boolean - True:Flow_Success, False:Flow_Failure</returns>
            public async Task<bool> Start() {
                if (PortCheck()) {
                    openBrowser($"{_authority}{_auth_endpoint}?client_id={CLIENT_ID}&scope=bot&state={_state}");

                    var resp = await StartAsync();
                    return resp;
                }
                return false;
            }


            /// <summary>
            ///  Attempt to see if port for loopback is in use currently.
            /// </summary>
            /// <returns>Boolean - True:Availabe, False:In_use</returns>
            /// <remarks>Flow should be stopped if an exception is thrown.</remarks>
            /// <exception cref="SocketException"></exception>
            /// <exception cref="Exception"></exception>
            /// <exception cref="BotException"></exception>
            private bool PortCheck() { //passed test
                try {
                    if (DEBUGGING_ENABLED) Print($"{name}:PortTest", $"Checking if port {LoopbackPort} is open", PrintSeverity.Debug);

                    using (TcpListener portListener = new TcpListener(IPAddress.Loopback, LoopbackPort)) {
                        portListener.Server.SetSocketOption(SocketOptionLevel.Socket, SocketOptionName.ReuseAddress, true);
                        portListener.Start();
                        portListener.Stop();
                        if (DEBUGGING_ENABLED) Print($"{name}:PortTest", $"Port {LoopbackPort} is available.", PrintSeverity.Debug);
                        return true;
                    }
                } catch (SocketException ex) {
                    new BotException($"{name}:PortTest", $"SocketException while trying to listen on port {LoopbackPort}. Is it in use by another program, or blocked by firewall?", ex);
                } catch (Exception ex) {
                    throw new BotException($"{name}:PortTest", $"Critical Exception while checking port {LoopbackPort}.", ex);
                }
                return false;
            }


            /// <summary>
            /// Open the URI to ask user for Authorization of resources.
            /// </summary>
            /// <param name="url">Complete HOST URI</param>
            /// <exception cref="Exception"></exception>
            private void openBrowser(string url) { //Code from ODIC Sample Code on Github. Note-To-Self: Don't try and improve on it because the catch is pretty fucking absolute.
                Print(name, $"Opening {_authority} in your webbrowser for Authorization.", PrintSeverity.Normal);

                try {
                    if (RuntimeInformation.IsOSPlatform(OSPlatform.Windows)) {
                        url = url.Replace("&", "^&");
                        Process.Start(new ProcessStartInfo("cmd", $"/c start \"\" {url}") { CreateNoWindow = true });
                        //firefox updated during writing the code and since I had firefox open, the old executable was in memory but a new executable was on disk
                        //the program would not launch a new instance of "firefox" because they were mismatching? or something else that I do not understand fully.
                        //upon restarting firefox it works
                    } else if (RuntimeInformation.IsOSPlatform(OSPlatform.Linux)) {
                        Process.Start("xdg-open", url);
                    } else if (RuntimeInformation.IsOSPlatform(OSPlatform.OSX)) {
                        Process.Start("open", url);
                    } else {
                        throw new Exception("Unable to Launch System Browser."); // !check This could be unobservable.
                    }
                } catch {
                    throw new BotException($"{name}:BrowserLauncher", $"Unable to launch a browser from ze program.");
                }
            }


            /// <summary>
            ///  Listens for HTTP events on localhost:port
            /// </summary>
            /// <param name="Token">Cancellation Token</param>
            /// <returns>Boolean - True:Code_Acquired, False:Failure</returns>
            private async Task<bool> StartAsync() { // Awaiting test verification
                bool _success = false;
                if (listener == null) throw new BotException($"{name}:Listener", $"This should be impossible to throw, but if you see this. Well shit.");

                listener.Start();
                if(DEBUGGING_ENABLED) Print(name, $"Listener started on port {LoopbackPort}. Waiting for response from {_authority}.", PrintSeverity.Debug);

                try {
                    while (!_ctc.IsCancellationRequested) {
                        var contextTask = listener.GetContextAsync();
                        var completedTask = await Task.WhenAny(contextTask, Task.Delay(300_000, _ctc.Token)); //timeout after 5 minutes

                        if (completedTask != contextTask)
                            throw new BotException(name, _ctc.Token.IsCancellationRequested ? $"The operation was cancelled." : $"Operation timed-out while waiting for response from {_authority}");

                        var listenerCtx = await contextTask;

                        using (var reader = new StreamReader(listenerCtx.Request.InputStream)) {
                            var requestBody = await reader.ReadToEndAsync();
                            string _code = listenerCtx.Request.QueryString["code"] ?? string.Empty;
                            string _return_state = listenerCtx.Request.QueryString["state"] ?? string.Empty;

                            if (!string.IsNullOrEmpty(_code)) {
                                if (string.IsNullOrEmpty(_return_state) || _return_state != _state) { /* This needs to be fleshed out if you want to really check for MiTM. I'm only going to throw an error, and continue the flow. */
                                    new BotException($"{name}:Listener", $"Unable to verify return state from {_authority}. (State: '{_return_state}' expected '{_state}'");
                                }

                                _ = _oauth_callback_code(_code);

                                _success = true;
                            } else {
                                throw new BotException($"{name}:Listener", $"Could not get authorization from {_authority}. (No code returned)");
                            }
                        }

                        listenerCtx.Response.ContentType = "text/html";
                        await using (var writer = new StreamWriter(listenerCtx.Response.OutputStream))
                            // It's a picture of a cat. Needed? no. Wanted? yes.
                            // SVG by Gordon Johnson (@https://pixabay.com/users/gdj-1086657/)
                            await writer.WriteAsync("<!DOCTYPE html><html lang=\"en\"><head><title>Shimamaru — Authorization Successful</title><style>html,body{background-color:#1c221b;color:#fbe448;text-align:center}h1{margin:auto;text-align:center;padding-top:9rem}.kitty{background-image:url(data:image/svg+xml;base64,);background-size:cover;background-repeat:no-repeat;width:320px;height:403px}.kitty.left{position:absolute;left:0;top:0}.kitty.right{position:absolute;right:0;top:0;transform:scaleX(-1)}.btn{margin:auto;margin-top:5.56rem;font-size:1.23rem;background:#1c221b;color:#fbe448;border-radius:21px;border-color:#e96e29;padding:.4rem 1.69rem .4rem 1.69rem}</style></head><body><div class='kitty left'></div><h1>You may now close this page.</h1><button class=\"btn\" onclick=\"window.close()\">Click to Close</button><div class='kitty right'></div></body></html>");

                        if (DEBUGGING_ENABLED) Print(name, $"Received OAuth code from {_authority}.", PrintSeverity.Debug);

                        break; // Hunting season if you will
                    }
                }
                catch (BotException) { /* ignore recursion */ }
                catch (Exception ex) { //Tell me where'd you'd rather be?
                    new BotException($"{name}:Listener", $"Unhandled Exception.", ex);
                } finally { //I can hardly see the moon
                    if (listener.IsListening) listener.Stop();
                    if (DEBUGGING_ENABLED) Print($"{name}:Listener", $"Temp webserver shutdown gracefully.", PrintSeverity.Debug);
                }
                return _success;
            }

            public void Dispose()
            {
                if (listener != null) {
                    if (listener.IsListening) listener.Stop();
                    listener = null;
                }
            }
        }
    }
